    false,nt"url": null,nt"notes": "This narrative report for Calhoun National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1950. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife including migratory birds, furbearers,
    raptors, and fish is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include sharecropping. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, fishing, and
    violations. NR forms are attached.",nt"license_title": "License Not Specified",nt"extras":
